import { Card, CardContent, Typography, Box } from "@mui/material";
import SpeedIcon from "@mui/icons-material/Speed";
import { grey } from "@mui/material/colors";

export default function PressureContainer({ pressure }) {
  return (
    <Card
      variant="outlined"
      sx={{
        backgroundColor: grey[50],
        borderRadius: 4,
        boxShadow: 3,
        width: "100%",
        my: 2,
      }}
    >
      <CardContent
        sx={{
          display: "flex",
          alignItems: "center",
          gap: 2,
          padding: 2,
          boxSizing: "border-box",
        }}
      >
        <SpeedIcon sx={{ fontSize: 50, color: grey[600] }} />
        <Box>
          <Typography variant="h6" fontWeight="medium">
            Pressure
          </Typography>
          <Typography variant="h5" fontWeight="bold">
            {pressure} hPa
          </Typography>
        </Box>
      </CardContent>
    </Card>
  );
}
